import React from "react";
export default function Grid(props) {
  let badgeText;
  if (props.openSpots === 0) {
    badgeText = "SOLD OUT";
  } else if (props.region === "Online") {
    badgeText = "ONLINE";
  }
  return (
    <div className="contact-card">
      {props.openSpots === 0 && <div className="card--badge">SOLD OUT</div>}
      <img className="card1" src={props.image} alt="Main page image" />
      <div className="class1">
        <img className="star" src="../images/star.png" />
        <span>{props.rating}</span>
        <span className="grey">{props.rating_count} â€¢ </span>
        <span className="grey">{props.region}</span>
        <h2 className="h2_element">{props.title}</h2>
        <p>
          <b>From ${props.price}</b> /person
        </p>
      </div>
    </div>
  );
}
